inline const unsigned* GetFaurePermutation(
    const unsigned aID)
{
    return FAURE_PERMUTATIONS + FAURE_PERMUTATION_OFFSETS[aID];
}

inline float HaltonFaureBase(
    unsigned aSeed,
    const unsigned aBase,
    const unsigned* aPermutation)
{
    float ret = 0.f;
    const float invBase = 1.f / aBase;
    float invBi = invBase;

    while(aSeed > 0)
    {
        ret += aPermutation[aSeed % aBase] * invBi;
        aSeed /= aBase;
        invBi *= invBase;
    }

    return ret;
}

inline const Vector2D HaltonFaure2DBase(
    unsigned aSeed,
    const unsigned aBaseX,
    const unsigned aBaseY,
    const unsigned* aPermutationX,
    const unsigned* aPermutationY)
{
    return Vector2D(
        HaltonFaureBase(aSeed, aBaseX, aPermutationX),
        HaltonFaureBase(aSeed, aBaseY, aPermutationY));
}

inline Vector2D HaltonFaure2D(int aSeed,
    const int aBaseIndexX,
    const int aBaseIndexY)
{
    return HaltonFaure2DBase(
        aSeed, GetPrime(aBaseIndexX), GetPrime(aBaseIndexY),
        GetFaurePermutation(aBaseIndexX), GetFaurePermutation(aBaseIndexY));
}

inline float HaltonFaure(
    unsigned aSeed,
    const unsigned aBaseIndex)
{
    return HaltonFaureBase(
        aSeed, GetPrime(aBaseIndex), GetFaurePermutation(aBaseIndex));
}

